tables.table_schema:
CREATE TABLE DiseaseOutbreaks (
	disease_id INT,
	disease_name VARCHAR,
	environmental_factor VARCHAR,
	population_health_data VARCHAR
);

CREATE TABLE EnvironmentalFactors (
	factor_id INT,
	factor_name VARCHAR,
	factor_description VARCHAR
);

CREATE TABLE PopulationHealthData (
	population_id INT,
	population_name VARCHAR,
	population_health_status VARCHAR,
	population_density INT
);
